import React, { useState, useEffect } from "react";
import axios from "axios";

export default function LightDetect({name, all, lights}) {

	function onToggle(e) {
		lights.forEach((v) => {
			console.log(v);
		});
	}

	console.log(name, all, lights);
	return (
    	<div key={name}>
		<p>{name}</p>
		<p>{lights.toString()}</p>
		<input
          		type='checkbox'
			onClick={(e) => onToggle(e)}
        	/>
    	</div>
  	);
}
